import React from 'react'
import { TextField } from '@material-ui/core'

export const TaskNameInput = ({ data, edit, work }) => {
    let isAccess

    if(work){
        isAccess = true
    } else {
        isAccess = false
    }

    return(
        <div>
            <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        </div>
    )
}
